import React from "react";
import { Row, Col, Button } from "antd";
import list from "../assets/list.json";

const Question = ({ index }) => {
	const l = list.arr;
	// console.log(l[0].q);

	//const q = l[{ index }].q;
	const a1 = l[{ index }].a1;
	const a2 = l[{ index }].a2;

	return (
		<>
			<Row justify="center">
				<Col xs="16" sm="16" md="16" lg="8">
					<h1>{l[{ index }].q}</h1>
				</Col>
			</Row>
			<Row gutter={{ xs: 16, sm: 16, md: 16, lg: 8 }} justify="center">
				<Col xs="16" sm="16" md="16" lg="8">
					<Button>{a1}</Button>
				</Col>
			</Row>
			<Row gutter={{ xs: 16, sm: 16, md: 16, lg: 8 }} justify="center">
				<Col xs="16" sm="16" md="16" lg="8">
					<Button>{a2}</Button>
				</Col>
			</Row>
		</>
	);
};

export default Question;
